/*
    该文件是整个项目的入口文件
*/
//引入Vue
import Vue from 'vue'
//引入App组件，它是所有组件的父组件
import App from './App.vue'
//关闭vue的生产tiwhi
export default new Vue({
    el: '#root',
    components:{
        App
    },
    render: h => h(App),
    template: `
        <App></App> 
    `

})
